import { Link } from 'react-router-dom'
import { useState } from 'react'
import styled from 'styled-components'
import logo from '../assets/foodLogo.png'
import menu from '../assets/menu.png'

const ListStyle = styled.ul`
list-style: none;
display: flex;
justify-content: flex-end;
gap: 30px;
padding: 0 30px;
`
const linkStyle = {
  textDecoration: 'none',
  color: 'black'
}

const Logo = styled.img`
width: 150px;
height: 150px;
padding-top: 15px;
`

const HideList =styled.div `
left: 0;
`

const NavBar = styled.nav`
display: flex;
justify-content: space-between;
align-items: center;
background-color: #FDF5DF;
width: 100vw;
padding: 10px;
height: 15vh;
font-size: 20px;
> img {

}
`

const Menu = styled.img`
@media (min-width: 600px) {
  display: none;
}
position: absolute;
top: 40px;


`

const showMenu = () => {

}

function Navbar() {

  const [isOpen, setIsOpen] = useState(false);

  return (
    <NavBar className='navBar'>
      <Logo src={logo} alt='what to eat logo'/>
      <ListStyle>
        <Menu src={menu} alt='hamburger menu' />
        { isOpen ? <HideList> <li><Link className='navLink' style={linkStyle} to='/'>Home</Link></li>
        <li><Link className='navLink' style={linkStyle} to='/List'>List</Link></li>
        <li><Link className='navLink' style={linkStyle} to='/Random'>Random</Link></li> </HideList> : '' }

      </ListStyle>  
    </NavBar>
  )
}

export default Navbar
